a.xlink:title:
From house.room.room.noHeatReq.idleNotHeat to house.room.room.noHeatReq.waitForHeat automaticallyGuard: [(setTemp - actualTemp) > 2]Transition Action:
     setValvePos(valvePos + 1); 
  			setWaitedForWarm(0);

From house.room.room.noHeatReq.waitForHeat to house.room.room.noHeatReq.waitForHeat automaticallyGuard: [(valvePos != 2) && (waitedForWarm == WARMUPTIMER)]Transition Action:
     setValvePos(valvePos + 1); 
  			setWaitedForWarm(0);

From house.room.room.heatReq.idleHeat to house.room.room.heatReq.waitForCool automaticallyGuard: [(actualTemp - setTemp) > 2]Transition Action:
     setValvePos(valvePos - 1); 
  			setWaitedForCool(0);

From house.room.room.heatReq.waitForCool to house.room.room.heatReq.waitForCool automaticallyGuard: [(valvePos != 0) && (COOLDOWNTIMER == waitedForCool)]Transition Action:
     setValvePos(valvePos - 1); 
  			setWaitedForCool(0);
